import React, { Component } from "react";
import Navbar from "./components/Navbar";
import AboutMe from "./components/AboutMe";
import { BrowserRouter, Route } from "react-router-dom";
import Languages from "./components/Languages";
import Projects from "./components/Projects";

class App extends Component {
  constructor() {
    super();
    this.state = {
      currentPage: window.location.pathname
    };
  }

  componentDidUpdate(prevState) {
    if (this.state.currentPage !== window.location.pathname) {
      // let newPage = this.fetchData(window.location.pathname);
      this.setState({ currentPage: window.location.pathname });
    }
  }

  render() {
    return (
      <BrowserRouter>
        <div className="box">
          <Route path="/" render={props => <Navbar {...props} />} />
          <Route exact path="/" component={AboutMe} />
          <Route path="/languages" render={props => <Languages {...props} />} />
          <Route path="/projects" component={Projects} />
          {/* {console.log(window.location.href)} */}
        </div>
        {console.log(this.state.currentPage)}
        {console.log(this.props)}
      </BrowserRouter>
    );
  }
}

export default App;
